import React from 'react';
import {Container, Col, Row} from 'react-bootstrap';
import Videos from '../components/Videos';

const VideoComponent = () => {
  return (
    
        <Container>
      <Row>
        <Col>
        <button> Add Video</button>
        </Col>
        <Col>
        <input type="text" > </input>
        </Col>
      </Row>


        <Videos />
    </Container>
  )
}

export default VideoComponent;
